/*!40000 ALTER TABLE `faq` DISABLE KEYS */;
INSERT INTO `faq` VALUES (3,1,'如何充值游戏仙尊？有多少个仙尊等级？','通过“仙尊”系统可进行充值，游戏中仙尊最高为15阶'),(4,2,'在哪里可以查看游戏活动？','玩家通过“活动中心”可及时查阅到每天游戏中的所有活动情况。也可以通过《仙侠道》官网了解最新的活动资讯'),(5,3,'体力恢复时间为多久？怎样购买体力？','每5分钟恢复1点体力，通过元宝购买每次可以获得100点体力'),(6,5,'深渊玩法介绍？怎样进入深渊？深渊副本有什么奖励？','每个城镇地下都会有对应的深渊关卡，通过深渊关卡是获得紫色装备的主要途径'),(7,6,'如在打副本（深渊）中掉线，上线后会出现在哪个地图？体力是否扣完？','如果在关卡进行中掉线，则重新登入还是会在当前关卡中，并且不扣体力'),(8,7,'如何精炼、重铸装备？装备品质情况怎么分？可以怎么获得高品质装备？','点击“装备”就会看到对应选项。目前版本中装备品质分为橙>金〉紫〉蓝。玩家通过深渊关卡或参与活动将有机会获得高品质装备。'),(9,4,'如何开启新副本地图？道具怎么获得？','通过“光明钥匙”才能开启新城镇地图，光明钥匙的主要来源可以通过“每日任务”“活动中心”等奖励中获得'),(10,8,'为什么我等级和他一样高，他的攻击力却比我高很多？','游戏中除了等级之外，玩家还可以通过“装备精练、重置、魂侍培养”等其他系统玩法提高攻击属性'),(11,9,'铜钱的作用是什么？怎么获得铜钱？','铜钱游戏中最主要的货币之一，玩家可以通过副本掉落及开元通宝获得铜钱。除此之外游戏中大量活动也是玩家收货铜钱的有效途径'),(12,10,'魂侍如何收集、升级、进阶？游戏中怎样触发魂侍技能？','彩虹桥是魂侍收集的主要渠道，玩家也可以通过“神龙宝箱”花费元宝进行抽取。游戏中，玩家通过积累魂力从而出发魂侍技能'),(13,11,'灵宠是什么？怎么获得？用法是什么？','灵宠是游戏中伴随玩家一起斩妖除魔的主要战力之一，玩家在部分关卡中会有几率抓捕到各式各样的灵宠。战斗中需要消耗精气才能召唤灵宠协助战斗哦！');
/*!40000 ALTER TABLE `faq` ENABLE KEYS */;
