INSERT INTO `ghost_passive_skill` VALUES (1,'护盾1级','HunShiShouHu','当生命少于30%时，自动施放吸收伤害的魂侍护盾，持续3回合。魂侍护盾吸收的伤害等于魂侍生命值的25%，与其他魂侍合计。魂侍护盾每次战斗只能触发1次',2),(3,'护盾2级','HunShiShouHuErJi','当生命少于30%时，自动施放吸收伤害的魂侍护盾，持续3回合。魂侍护盾吸收的伤害等于魂侍生命值的50%，与其他魂侍合计。魂侍护盾每次战斗只能触发1次',3),(5,'护盾3级','HunShiShouHuSanJi','当生命少于30%时，自动施放吸收伤害的魂侍护盾，持续3回合。魂侍护盾吸收的伤害等于魂侍生命值的75%，与其他魂侍合计。魂侍护盾每次战斗只能触发1次',4),(6,'护盾4级','HunShiShouHuSiJi','当生命少于30%时，自动施放吸收伤害的魂侍护盾，持续3回合。魂侍护盾吸收的伤害等于魂侍生命值的100%，与其他魂侍合计。魂侍护盾每次战斗只能触发1次',5);
