INSERT INTO `mail` VALUES (1,'BagFull',0,'背包已满提示','func,功能','您的背包已满，系统已自动将{0}的物品暂存至附件，请及时点击领取',1,0),(2,'Heart',0,'爱心赠送邮件','who,发送者','您的好友{0}赠送您一颗爱心哦！请及时点击领取。',1,0),(3,'TestMail',0,'测试邮件','p1, 参数1; p2, 参数2','我{0}只是一封测试邮件{1}，虽然偶只是测试用的，但四，你八可以八理我，if你不点我我that会伤心的。so !选我！选我！选我！',1,0),(4,'MultiLevel',0,'多人关卡战斗奖励','name,关卡名称','您在参与的多人关卡{0}中取得了胜利，附件里是您获得的奖励。',1,0),(6,'GhostBagFull',0,'魂侍背包已满提示','func,功能','您的魂侍背包已满，系统已自动将您刚抽取到的{0}个魂侍暂存至附件，请及时点击领取。',0,0),(7,'SwordSoulBagFull',0,'剑心背包已满提示','func,功能','您的剑心背包已满，系统已自动将您刚抽取到的{0}个剑心暂存至附件，请及时点击领取。',1,0),(8,'Recharge',0,'充值成功','time1,时间; num,充值元宝数量','恭喜您在{0}成功充值{1}元宝，仙侠道团队感谢您对我们游戏的支持。',0,0),(9,'PurchaseTips',0,'购买道具成功提示','source,来源;item_name,道具名称;func,功能;','尊敬的大侠，恭喜您刚刚从{0}得到了{1}，此道具可在{2}功能开放后在此系统背包中查看。',0,0),(10,'DrawTips',0,'神龙宝箱获得提示','item_name,道具名称;func,功能;','尊敬的大侠，恭喜您刚刚得到了{0}，此道具可在{1}功能开放后在此系统背包中查看。',0,0),(11,'PlatformFriendAward',0,'邀请好友奖励','friend_num,人数;item_num,数字;item_name,道具','又有小伙伴加入我们的大家庭啦～恭喜大侠的好友数已达到{0}人，我们很愉快的赠送给您{1}个{2}，邀请更多好友加入仙侠道，有更多精彩好礼等您来拿。',1,0),(12,'WelcomeBeta',0,'感谢参与封测','','这是《仙侠道》首次与广大仙友的亲密接触，欢迎大家在体验过程中提出各种宝贵的意见和建议。\r\n官方QQ交流群：397324414',0,1),(13,'WarTips',0,'比武场宝箱领取提醒','nun,排名','尊敬的大侠～您在比武场的精彩表现万众瞩目～截止昨日24点，您的比武场排名为{0}，快去比武场领取您的比武场宝箱吧～',1,0),(14,'VIPHeart',0,'仙尊每日爱心','','您是一位让人爱戴的侠客！',1,0),(15,'ShenJiHuoDong',0,'升级活动（废弃）','','活动时间：内测期间\r\n活动内容：玩家等级达到相应条件，就可领取对应奖励\r\n活动奖励：\r\n5级—30级   每提升5级即可获得“5个铜钱袋”\r\n35级—60级  每提升5级即可获得“10个铜钱袋”\r\n（奖励也将通过邮件形式发放，请注意查收）',1,1),(17,'HuoDongJiangLi',0,'升级活动奖励（废弃）','','升级活动奖励，请注意查收',1,0),(18,'VIPSignAward',0,'仙尊签到奖励','','尊敬的仙尊玩家，以下是本次仙尊双倍奖励内容，请注意查收。',1,0),(19,'ZhanLiHuoDong',0,'战力活动','','活动时间：内测期间\r\n活动内容：玩家队伍战力达到相应条件，就可领取对应奖励\r\n活动奖励：\r\n总战力5000    奖励58元宝\r\n总战力10000  奖励68元宝\r\n总战力20000  奖励88元宝\r\n总战力30000  奖励128元宝\r\n总战力40000  奖励188元宝\r\n总战力50000  奖励248元宝\r\n总战力60000  奖励388元宝\r\n（奖励也将通过邮件形式发放，请注意查收）',0,1),(20,'ZhanLiHuoDongJiangLi',0,'战力活动奖励','','战力活动奖励，请注意查收',1,0),(22,'XianZun',0,'仙尊特权奖励','vip_num,vip等级','恭喜您提升到仙尊{0}级，请注意查收奖励内容',1,1),(23,'DaoJuHuoDe',0,'道具获得提示','item_name,道具名称;func,功能;','尊敬的大侠，恭喜您刚刚得到了{0}，此道具可在{1}功能开放后在此系统背包中查看。',0,0),(24,'QiriXinShouLi',0,'七日新手礼活动（废弃）','','感谢您对仙侠道的支持，以下是今日登入奖励！',0,0),(25,'DaZuoTiXing',0,'打坐小提醒','','尊敬的大侠，通过不断的努力，您已经能够进行打坐啦！为了能够更快提升实力拯救大地，当您离线10分钟后将会自动进入打坐状态哦~！',0,0),(26,'ZhuCe',0,'注册好礼','','欢迎大侠进入仙侠道的世界！在此送上我们的一点小心意！请注意查收哦！请大侠愉快的玩耍吧！',1,0),(28,'NewbieGift',0,'侠客见面礼','','欢迎大侠进入仙侠道！在此送上我们的小小心意！大侠注意查收哦！',1,0),(29,'ShouChongHaoHuaLi',0,'首充豪华礼','','恭喜大侠获得首充豪华礼，请注意查收附件',1,0),(30,'YaoQingLongYue',0,'胧月参上','','胧月很高兴能成为您的伙伴与您共闯仙侠道，在此为您奉上胧月的专属武器及魂侍，赶快装备起来让胧月变得更强吧！',1,0),(31,'RedPaper',0,'新春红包活动奖励','','尊敬的大侠，感谢您一直以来对仙侠道的支持，新春之际给您送上一个大大的红包~快打开看看吧~',0,0),(32,'QQVip',0,'会员独享新手礼包','','尊敬的会员玩家，在次奉上会员独享新手礼包，请注意查收。',0,0),(33,'QQSvip',0,'超级会员尊贵新手礼包','','尊贵的超级会员玩家，在此为您奉上超级会员尊贵新手礼包，愿您畅游仙侠道的世界。',0,0),(34,'QQvipXuFei',0,'会员开通/续费礼包','','尊敬的玩家，感谢您开通/续费QQ会员，在此奉上专属礼包，请注意查收。',0,0),(35,'QQSvipXuFei',0,'超级会员开通/续费礼包','','尊敬的玩家，感谢您开通/续费QQ超级会员，在此奉上专属礼包，请注意查收。',0,0),(36,'TotemBagFull',0,'阵印背包已满提示','num,数量','您的阵印背包已满，系统已自动将您刚抽取到的{0}个阵印暂存至附件，请及时点击领取。',0,0);
