INSERT INTO `npc_talk` VALUES (2,2,1,0,0,'N=我捡到了这个，送你\r\nP=谢谢，我就收下啦',209,1),(11,1,1,1,13,'N=森林有恶狼出没，梦妖们被吓坏了',0,0),(12,1,1,1,15,'N=听梦妖说，好像有伙伴出现在森林',0,0),(13,1,1,1,16,'N=阴影附身后伙伴会变的比平时更强\r\nP=勇者无畏，打过才知道。',0,0),(14,1,1,1,19,'N＝阴影的气息更加强烈了，请小心\r\nP＝谢谢，我会注意的',0,0),(15,1,1,1,20,'N=这里的气息十分的厉害，请小心',0,0),(16,1,1,1,23,'N=莲花峰十分的美丽\r\nN=但是请小心阴影的袭击',0,0),(17,1,1,1,25,'N=莲花峰的金蟾王很善良\r\nN=但是千万别说它肥哦。',0,0),(18,1,1,1,26,'N=要击杀附体的阴影\r\nN=只要打败被附体的人就可以哦',0,0),(19,1,1,1,27,'N=梦妖们说在溶洞附近能闻到恶臭',0,0),(20,1,1,1,28,'N=山洞中越来越臭了\r\nN=不舒服时记得回来休息下',0,0),(21,1,1,1,29,'N=在山洞深处有股阴影之源\r\nN=请小心',0,0),(22,1,1,1,30,'N=臭泥除了非常臭\r\nN=还带有剧毒哦',0,0),(23,1,1,1,31,'N=梦妖们正在努力寻找其余的伙伴',0,0),(24,1,1,1,33,'N=梦妖们打听到火山附近有伙伴行踪',0,0),(26,1,1,1,35,'N=请小心燃魁首领',0,0),(27,1,1,1,61,'N=请小心燃魁首领',0,0),(28,1,1,1,62,'N=火山的深处有一只凶暴的炎龙\r\nN=请小心',0,0),(29,1,1,1,38,'N=火山的深处有一只凶暴的炎龙\nN=请小心',0,0),(30,1,1,1,39,'N=凶暴的炎龙讨厌凡人进入它的领地\nN=所以请小心！',0,0),(31,1,1,1,40,'N=密室很暗，请小心守护者',0,0),(32,1,1,1,41,'N=在密室中拥有很多充满灵性的飞剑',0,0),(34,1,1,1,42,'N=请小心守护密室的剑魂',0,0),(35,1,1,1,63,'N=上古的剑魂是非常厉害的',0,0),(36,1,1,1,43,'N=野外很危险，请小心！',0,0),(39,1,1,1,45,'N=密室的深处感觉到一道剑气',0,0),(40,1,1,1,46,'N=古代剑灵很厉害\nN=但是能获得很好的奖励',0,0),(56,9,1,1,13,'N=在战斗中要注意治疗哟！\r\nP=恩！知道了！',209,1),(57,8,1,1,19,'N=听说大侠身上都常备止血草的。\r\nP=我知道，治疗效果很好呢！',209,1),(60,20,2,0,0,'N=这几把飞刀你收好\r\nN=关键时刻可以防身用\r\nP=恩！回头请你喝酒',213,2),(61,13,2,0,0,'N=这是我从神龙岛带出来的草药\r\nN=你应该用的上\r\nP=谢谢',209,1),(64,6,1,1,13,'N=大侠我这有点止血草送给你\r\nP＝谢谢你',209,1),(65,7,1,1,19,'N＝这是我在草丛里捡到的，送给你',263,1),(66,8,1,1,23,'N=请记得强化装备哦',209,1),(67,12,1,1,23,'N＝这个给你拿去提升魂侍\r\nP＝客气',263,2),(68,11,1,1,27,'N＝这是给你的礼物哦\r\nP＝我会好好的使用的',209,1),(70,9,1,1,33,'N＝这是我在草丛里捡到的，送给你',263,5),(71,5,1,1,37,'N＝这是我在影界采到的果实',263,5),(73,11,1,1,45,'N＝累了，记得回来休息下',0,0),(77,18,2,1,99,'N＝我这有些止血草，送给你\r\nP＝谢谢你媛媛',209,2),(78,20,2,1,112,'N＝这有几个魂侍果实给你\r\nP=恩！回头请你喝酒',263,5),(79,13,2,1,112,'N＝这是龙姬大人叫我给你送来哒～\r\nP＝帮我谢谢龙姬',263,5),(80,20,2,1,119,'N=在战斗中要灵活运用不同绝招！\r\nP=恩！知道了！',0,0),(81,18,2,1,127,'N＝我这有些止血草，送给你\r\nP＝谢谢你媛媛',209,3),(82,19,2,1,135,'N＝这是我在游玩的时候捡到的\r\nN＝送给你吧\r\nP＝谢谢晓芸妹妹',239,2),(83,13,2,1