INSERT INTO `opera_announcement` VALUES (2,'五日累积登入！送极品！','活动时间：删档测试期间\r\n活动内容：玩家累积登入5天，每日可领取各种极品奖励\r\n活动奖励：\r\n天数           奖励内容\r\n第一天       200元宝\r\n第二天       专属魂侍“将臣”\r\n第三天       珠宝盒（约50W铜钱）\r\n第四天       金色剑心“赤霄”\r\n第五天       588元宝',1411962120,0),(3,'升等级，送福利！','活动时间：删档测试期间\r\n活动内容：玩家等级达到相应条件，就可领取对应奖励\r\n活动奖励：\r\n5级—30级     每提升5级即可获得“5个铜钱袋”\r\n35级—60级   每提升5级即可获得“10个铜钱袋”\r\n（奖励将通过邮件形式发放，请注意查收）',1411962660,0),(4,'升战力，送元宝！','活动时间：删档测试期间\r\n活动内容：玩家战力达到相应条件，就可领取对应元宝\r\n活动奖励：\r\n战力        奖励元宝\r\n5000           58元宝\r\n10000      68元宝\r\n20000      88元宝\r\n30000      128元宝\r\n40000      188元宝\r\n50000      248元宝\r\n60000      388元宝',1411962660,0),(5,'冲级公测返奖励','活动时间：删档测试期间\r\n活动描述：玩家在内测达到一定等级级别，公测返礼包奖励\r\n活动奖励：\r\n25级     返还200元宝\r\n35级     返还250元宝\r\n40级     返还300元宝',1411962660,0),(6,'充值元宝双倍返利！','活动时间：删档测试期间\r\n活动描述：在删档测试期间，单笔充值金额满足每个档位的对应的金额，即赠送等额元宝，并在公测期间返还全部元宝，但不返还VIP等级',1412758800,0);
