DROP TABLE IF EXISTS `quest_activity_center`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `quest_activity_center` (
  `id` smallint(6) NOT NULL AUTO_INCREMENT,
  `relative` smallint(6) NOT NULL COMMENT '关联的活动',
  `weight` int(8) NOT NULL DEFAULT '0' COMMENT '活动权值',
  `name` varchar(60) NOT NULL COMMENT '活动名称(列表左侧)',
  `title` varchar(100) NOT NULL COMMENT '活动标题(列表右侧)',
  `content` text NOT NULL COMMENT '活动描述',
  `start` bigint(20) DEFAULT '0' COMMENT '活动开始时间戳',
  `end` bigint(20) DEFAULT '0' COMMENT '活动结束时间戳',
  `is_go` tinyint(4) DEFAULT NULL COMMENT '是否前往',
  `tag` tinyint(4) DEFAULT NULL COMMENT '活动标签(1:最新,2:限时,3:推荐)',
  `is_mail` tinyint(4) DEFAULT '0' COMMENT '活动结束是否补发奖励',
  `condition_template` varchar(60) DEFAULT NULL COMMENT '领奖条件模版,{val}代表临界值',
  `dispose` bigint(20) DEFAULT NULL COMMENT '活动过期时间戳',
  `sign` varchar(40) DEFAULT NULL COMMENT '活动标识',
  `mail_title` varchar(60) DEFAULT NULL COMMENT '补发奖励邮件标题',
  `mail_content` text COMMENT '补发奖励邮件内容,{val}对应权值',
  `is_relative` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否为相对时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8mb4 COMMENT='任务活动中心';
/*!40101 SET character_set_client = @saved_cs_client */;

/*!40000 ALTER TABLE `quest_activity_center` DISABLE KEYS */;
INSERT INTO `quest_activity_center` VALUES (1,3,20,'累计登入','累计登入','活动期间，玩家累积登入7天，每日可领取各种极品奖励 \r\n活动奖励：\r\n天数           奖励内容\r\n第一天       200元宝\r\n第二天       珠宝盒（约50W铜钱）\r\n第三天       时装及紫色结晶（50个）\r\n第四天       金色魂侍“洛神”\r\n第五天       极品灵宠“雷兽”\r\n第六天       金色剑心“赤霄”（邮件发放）\r\n第七天       潜龙剑心10个（邮件发放）',1414512000,1414598400,1,1,0,'',1414598400,'EVENT_LOGIN_AWARD','','',0),(2,1,4,'等级活动','等级活动','活动期间，玩家每提升5级即可领取对应等级奖励 。\r\n活动奖励：\r\n15级       500铜钱\r\n20级       1000铜钱\r\n25级       5000铜钱\r\n30级       10000铜钱\r\n35级       15000铜钱\r\n40级       20000铜钱\r\n45级       25000铜钱\r\n50级       30000铜钱\r\n55级       35000铜钱\r\n60级       40000铜钱',0,2591999,0,2,0,'等级{val}',2591999,'EVENT_LEVEL_AWARD','','',1),(3,2,5,'战力活动','战力活动','活动期间，玩家达到指定战力可领取对应战力奖励 。\r\n活动奖励：\r\n战力20000       100元宝\r\n战力50000       200元宝\r\n战力75000       300元宝\r\n战力100000     400元宝',0,2591999,0,2,0,'战力{val}',2591999,'EVENT_STRONG_AWARD','','',1),(5,4,11,'首充元宝双倍返利','首充元宝双倍返利','活动期间，首次单笔充值金额满足每个档位对应金额（60元宝除外），即赠送等额元宝。\r\n 活动奖励：\r\n首充300元宝             赠送300元宝\r\n首充980元宝             赠送980元宝\r\n首充1980元宝           赠送1980元宝\r\n首充3280元宝           赠送3280元宝\r\n首充6480元宝           赠送6480元宝',0,0,1,3,0,'',0,'EVENT_RECHARGE_AWARD','','',0),(6,5,9,'最强王者','限时比武大会，谁是最强王者！','新服开启3天内，玩家进行比武场排名竞技，活动结束阶段根据玩家最终排名所在区间，给予对应活动奖励！届时玩家可在活动结束阶段（3天）前往该界面领取奖励。\r\n第1名                2000元宝\r\n第2名                1000元宝\r\n第3名                750元宝 \r\n第4～10名         500元宝\r\n第11～50名       300元宝\r\n第51～100名     200元宝\r\n第101～500名   100元宝',0,259200,1,2,0,'第{val}名',518399,'EVENT_ARENA_RANK_AWARDS','','',1),(7,6,100,'通关奖励翻倍','通关奖励翻倍！','玩家通过（普通关卡、精英关卡、BOSS关卡）中所获铜钱&经验奖励翻倍 \r\n活动时间：2014年11月10日-2014年11月23日',1414512000,1414598400,2,0,0,'',1414598400,'EVENT_MULTIPY_CONFIG','','',0),(8,7,1,'消耗体力换奖励','消耗体力换奖励','玩家每日消耗体力数累计达到活动奖励条件时，即可领取丰厚奖励！',0,1209599,0,4,0,'消耗体力{val}',1209599,'EVENT_PHYSICAL_AWARDS','','',1),(9,8,2,'月卡返利','月卡返利','单笔充值购买300元宝及以上，可自动激活月卡返利活动。\r\n激活后30天内，每天可领取100元宝奖励。',0,0,0,3,0,'',0,'EVENT_MONTH_CARD_AWARDS','','',0),(10,9,0,'豪华午餐','豪华午餐','每日 12：00 到 14：00 领取豪华午餐！吃饱喝足才有力气打怪哦！',0,0,0,4,0,'',0,'EVENT_DINNER_AWARDS','','',0),(11,10,0,'豪华晚餐','豪华晚餐','每日 18：00 到 20：00可领取豪华晚餐！为大侠补充体力～继续闯荡您的仙侠世界！',0,0,0,4,0,'',0,'EVENT_SUPPER_AWARDS','','',0),(12,11,15,'QQ特权奖励','QQ特权奖励','<font color=#FFD167 >特权一、通关奖励加成！</font>\r\nQQ会员玩家通过普通、精英及BOSS关卡时所获得经验和铜钱额外加成10%\r\n<font color=#FFD167 >特权二、每日登录奖励！</font>\r\nQQ会员玩家每日登录游戏，即可在该活动界面中领取当日福利奖励！连续登录更有额外奖励领取',0,0,0,0,0,'',0,'EVENT_QQVIP_GIFT_AWARDS','','',0),(13,12,17,'QQ特权奖励加成','QQ特权奖励加成','',0,0,0,0,0,'',0,'EVENT_QQVIP_ADDITION','','',0),(14,13,7,'仙尊俱乐部','仙尊俱乐部','当本服仙尊人数满足条件时，全体仙尊玩家均能享丰厚奖励！\r\n充值任意金额即能成为仙尊。',0,604799,0,3,0,'',604799,'EVENT_VIP_CLUB','','',1),(15,14,20,'土豪俱乐部','土豪俱乐部','当本服特定仙尊人数达标时，满足条件的仙尊玩家均能享受丰厚奖励！',1414512000,1414512000,0,3,0,'',1414512000,'EVENT_RICHMAN_CLUB','','',0),(16,15,30,'公测元宝返还','公测元宝返还','内测参加充值返利活动以及冲级活动的大侠可以前往仙侠道手游官方网站领取活动奖励哦！',1414512000,1414512000,2,3,0,'',1414512000,'EVENT_LEVEL_RECHARGE','','',0),(17,16,6,'首充奖励','首充奖励','玩家首次完成任意金额充值即可获得豪华首充奖励！\r\n活动奖励：\r\n星辉天诛戒x1\r\n喜好品（秘籍残页）X10\r\n爱心X10\r\n\r\n（奖励将以邮件发放，请注意查收）',0,0,1,3,0,'',0,'EVENT_FIRST_RECHARGE','','',0),(19,17,3,'七日新手礼','七日新手礼','活动期间，玩家每日登录可领取当日对应的极品奖励。\r\n 活动奖励：\r\n第一天       100元宝\r\n第二天       珠宝盒（约20W铜钱）\r\n第三天       限时时装\r\n第四天       128元宝及影界果实（50个）\r\n第五天       灵宠魔笔\r\n第六天       168元宝及灵魄（20个）\r\n第七天       喜好品（秘籍残页）x20\r\n（如当日未登录游戏即无法领取本日所对应的奖励）',0,0,1,4,0,'',0,'EVENT_SEVEN_DAY_AWARDS','','',0),(20,18,10,'江湖侠客乐分享','江湖侠客乐分享','大侠在仙侠道世界中成功分享的次数累计达到指定次数，可获得相应的奖励。',0,0,0,3,0,'',0,'EVENT_SHARE_AWARDS','','',0),(21,19,16,'团购活动','时装','活动期间，认购数量越多价格越优惠！若物品最终价格低于您认购时的花费，将退还差价。',1415548800,1415548801,0,2,0,'',1415548801,'EVENT_GROUP_BUY','','',0),(23,20,18,'累计充值狂欢','累计充值狂欢','元旦期间，玩家累计充值元宝（不计算赠送元宝）达到对应要求，对应物品奖励',1415548800,1415548800,0,2,0,'',1415548800,'EVENT_TOTAL_RECHARGE','','',0),(24,22,22,'邀请胧月','邀请胧月','初始等级[level]级，东瀛女忍者，性情阴晴不定，花费[ingot]即可邀请胧月加入队伍(赠送专属紫色武器及魂侍将通过邮件发放）',1414512000,1414512000,0,3,0,'',1414512000,'EVENT_BUY_PARTNER','','',0),(25,23,18,'十连抽大返利','十连抽大返利','活动期间，玩家累计十连抽宝箱（神魂宝箱及神兽宝箱）达到对应次数，即可领取即可领取胧月专属金色魂侍！',1415548800,1415548800,0,2,0,'',1415548800,'EVENT_TEN_DRAW','','',0),(26,21,18,'消费大返利','消费大返利','活动期间，玩家通过任意方式每消耗200元宝即可领取一个随机百宝箱，开启宝箱有几率获得极品魂侍武灵。',1415548800,1415548800,0,2,0,'',1415548800,'EVENT_TOTAL_CONSUME','','',0),(28,24,18,'每日充值礼','每日充值礼','活动期间，玩家每日首次完成任意金额充值，即可领取对“限定魂侍碎片”奖励。\r\n（若充值完成但当日未领取奖励，之后无法领取该日奖励）',1415548800,1415548800,0,2,0,'',1415548800,'EVENT_FIRST_RECHARGE_DAILY','','',0),(29,25,18,'连续登录奖励','连续登录奖励','圣诞期间，根据玩家连续登录天数，每日可领取对应不同连续登录天数的连续登录奖励。\r\n连续登录4天及以上为中级登录奖励\r\n连续登录7天及以上为高级登录奖励\r\n（若玩家一日未登录游戏，连续登录天数将会重置）',1415548800,1415548800,0,2,0,'',1415548800,'EVENT_TOTAL_LOGIN','','',0);
