CREATE TABLE `rainbow_level_award` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `mission_level_id` int(11) NOT NULL COMMENT '关卡id',
  `award_type` tinyint(4) NOT NULL COMMENT '奖励类型(0--铜钱;1--道具;2--装备 3--经验 4--经验倍数 5--铜钱倍数 6--恢复伙伴技能 7--恢复魂侍技能 8--恢复灵宠状态 9--主角精气 10--百分比生命 11-增加魂力)',
  `award_chance` tinyint(4) NOT NULL COMMENT '奖励概率',
  `award_num` int(11) NOT NULL COMMENT '奖励数量',
  `item_id` int(11) NOT NULL DEFAULT '0' COMMENT '物品ID(物品奖励填写)',
  `order` tinyint(4) NOT NULL COMMENT '品质顺序',
  `autofight_box` tinyint(4) DEFAULT '0' COMMENT '是否是扫荡宝箱',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2303 DEFAULT CHARSET=utf8mb4 COMMENT='彩虹关卡宝箱';
