DROP TABLE IF EXISTS `skill`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `skill` (
  `id` smallint(6) NOT NULL AUTO_INCREMENT,
  `name` varchar(10) DEFAULT NULL COMMENT '绝招名称',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '类型(0 - 系统；1 - 主角；5 - 怪物；7 - 魂侍技1； 8 - 魂侍技2)',
  `child_type` smallint(6) NOT NULL DEFAULT '1' COMMENT '绝招作用 1-攻击 3-防御 4-治疗 5-辅助 6-破甲',
  `child_kind` tinyint(4) NOT NULL DEFAULT '1' COMMENT '绝招子类型 1－基本 2-进阶 3-奥义',
  `sign` varchar(30) DEFAULT NULL COMMENT '资源标识',
  `music_sign` varchar(30) DEFAULT NULL COMMENT '音乐资源标识',
  `role_id` tinyint(4) NOT NULL DEFAULT '-1' COMMENT '角色ID',
  `required_level` int(11) NOT NULL DEFAULT '0' COMMENT '需要等级',
  `info` text COMMENT '绝招描述',
  `jump_attack` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否跳跃攻击',
  `display_param` int(11) NOT NULL DEFAULT '0' COMMENT '显示参数',
  `config` text COMMENT '绝招配置',
  `quality` tinyint(4) NOT NULL DEFAULT '0' COMMENT '技能品质',
  `can_add_level` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否可升级绝招(招式使用)',
  `parent_skill_id` smallint(6) NOT NULL DEFAULT '0' COMMENT '父绝招id(招式使用)',
  `order` smallint(6) NOT NULL DEFAULT '0' COMMENT '排序字段',
  `target` tinyint(4) NOT NULL DEFAULT '1' COMMENT '攻击目标（客户端展示用）',
  `warcry` varchar(1024) NOT NULL DEFAULT '' COMMENT '战吼',
  `cheat_id` smallint(6) DEFAULT '0' COMMENT '学习所需秘籍id',
  `auto_learn_level` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否达到等级习得',
  `required_fame_level` int(11) NOT NULL DEFAULT '0' COMMENT '需要声望等级',
  `required_friendship_level` int(11) NOT NULL DEFAULT '0' COMMENT '需要羁绊等级',
  `info_vars` text COMMENT '绝招描述参量',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1583 DEFAULT CHARSET=utf8mb4 COMMENT='绝招表';
