INSERT INTO `town_npc` VALUES (1,1,'龙姬','LongJi',1670,1280,'b','阴影这么多该怎么办！||我感觉体内有股奇怪的力量。',0,87,0),(2,1,'梦妖','MengYao',1560,1350,'rb','你见过神龙么？||没人知道我们梦妖一族从何而来',0,0,0),(3,1,'商人','ShangRen',1110,930,'rb','江湖险恶，常备良药才是保命上策||做点小生意不容易，多来光顾',10,0,0),(5,1,'梦妖小辉','MengYao',1247,1326,'rb','小杰说他是最熟悉神龙岛的人。||你想知道什么？',0,0,0),(6,1,'梦妖小杰','MengYao',2048,808,'t','我对神龙岛了如指掌。||传说在火山的内部有一个密室。||我知道一个长生不老的秘密。',0,0,0),(7,1,'梦妖小立','MengYao',1730,600,'t','我躲在这里谁也找不到我。||玩捉迷藏我最厉害了。||他们找了我两天都没找到我。||今天吃了小苹果，感觉自己萌萌哒',0,0,0),(8,1,'梦妖阿剑','MengYao',1900,700,'l','我也是出过岛的妖！||江湖上可是流传着我的传说。||我在黑夜森林看见了奇怪的黑影。',0,0,0),(9,1,'梦妖阿樂','MengYao',611,557,'l','宝剑尚未配妥，出门已是江湖。||我有一天梦见了上古的剑灵。',0,0,0),(10,2,'商人','ShangRen',2088,863,'lb','江湖险恶，常备各种良药才是上策||做点小生意不容易，多来光顾呀！',0,0,0),(11,1,'朱媛媛','ZhuYuanYuan',1402,1263,'rb','今天去哪里玩？',10,0,0),(12,1,'袁铭志','YuanMingZhi',1050,759,'r','走，喝酒去！',16,0,0),(13,2,'梦妖','MengYao',417,1147,'lb','龙姬大人….',0,0,0),(18,2,'朱媛媛','ZhuYuanYuan',1002,491,'r','烛堡好漂亮呀！',0,0,0),(19,2,'车晓芸','CheXiaoYun',1150,474,'l','带我去玩！带我去玩！',0,0,10),(20,2,'袁铭志','YuanMingZhi',623,628,'lb','听说烛堡产一种好酒',0,0,0),(21,2,'燕无名','YanWuMing',1313,887,'b','天地分阴阳，笔墨见真章',103,0,9),(22,2,'龙姬','LongJi',497,1275,'lt','怎么才能消灭所有阴影',104,168,0),(23,1,'瀛海集市','YingHaiJiShi',1475,538,'b','我来中州是为了结交各地江湖侠士||走过路过大侠不要错过～',0,0,0),(24,1,'神龙宝箱','ShenLongBaoXiang',2120,1100,'b','神龙会赐予你力量',1106,0,0),(26,1,'巡游商人','XunYouShangRen',2195,966,'lb','我又给大侠带了好东西～||小天快出来接客！',-1,-1,0),(27,2,'神龙宝箱','ShenLongBaoXiang',1664,993,'b','',0,0,0),(28,2,'瀛海集市','YingHaiJiShi',1905,907,'b','我们又见面了',0,0,0),(30,2,'巡游商人','XunYouShangRen',2338,735,'lb','我带来了新的货物～',-1,-1,0),(31,4,'龙姬','LongJi',2130,904,'lb','光明必将战胜黑暗||徐福....',0,785,0),(32,4,'朱媛媛','ZhuYuanYuan',1791,562,'lb','伙伴们终于都归队了',0,0,0),(33,4,'车晓芸','CheXiaoYun',1662,478,'rt','这里的风景真漂亮',0,0,10),(34,4,'袁铭志','YuanMingZhi',491,689,'rb','得知己，当痛饮三百杯',0,0,0),(35,4,'神龙宝箱','ShenLongBaoXiang',1240,930,'b','',0,0,0),(36,4,'瀛海集市','YingHaiJiShi',1077,1020,'b','大侠我们又见面了||看看有心仪之物否？',0,0,0),(37,4,'商人','ShangRen',1561,811,'b','做点小生意不